import React from 'react';

function Food({fav}) {

  return (
    <h3>
      I like {fav}. <br></br>
      {/* I hate {props.hate}. */}

    </h3>
  );
}

function App() {
  return (
    <div className="App">
      <Food fav="Banana"
            hate="seaweeds"
      ></Food>
    </div>
  );
}


export default App;
